function drawPolygon(context, xpoints, ypoints, fillStyle) {
    context.beginPath();
    context.moveTo(xpoints[0], ypoints[0]);
    for (var i = 1; i < xpoints.length; i += 1) {
        context.lineTo(xpoints[i], ypoints[i]);
    }
    context.lineTo(xpoints[0], ypoints[0]);
    context.stroke();
    context.closePath();
    if (fillStyle.localeCompare(NO_FILL) !== 0) {
        context.fillStyle = fillStyle;
        context.fill();
    }
}

