function displayResult(x, y) {
    document.getElementById("coords").innerHTML = "x: " + x + ", y: " + y;
}

function clearCanvas() {
    var canvas = document.getElementById("board");
    context = canvas.getContext("2d");
    context.clearRect(0, 0, canvas.width, canvas.height);
    return context;
}

function onMouseDown(e) {
    mouseDown = true;
}

function onMouseUp(e) {
    mouseDown = false;
}

function onMouseMove(e) {
    var bounds = e.target.getBoundingClientRect();
    var jsonToJava = {
        trigger: TRIGGER_MOUSE_MOVE,
        mouseDown: mouseDown,
        mouseX: e.clientX - bounds.left,
        mouseY: e.clientY - bounds.top
    };
    communicateWithJava(jsonToJava);
}

function communicateWithJava(jsonToJava) {
    var xhr = new XMLHttpRequest();
    xhr.onreadystatechange = function () {
        if (xhr.readyState === 4) {
            var jsonStrFromJava = xhr.responseText;
            updateBoard(jsonStrFromJava);
        }
    };
    xhr.open('POST', 'Main', true);
    xhr.send(JSON.stringify(jsonToJava));
}

function timeTick() {
    var jsonToJava = {
        trigger: trigger,
        mouseDown: false,
        mouseX: -1,
        mouseY: -1
    };
    communicateWithJava(jsonToJava);
    trigger = TRIGGER_TIME_TICK;
}

function reset() {
    clearInterval(myInterval);
    mouseDown = false;
    trigger = TRIGGER_INIT;
    document.getElementById("coords").innerHTML = "---";
}

